import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import './App.css';

function App() {
  return (
    <div className="App">
      <Box
        component="form"
        sx={{
          '& > :not(style)': { m: 1, width: '25ch' },
        }}
        noValidate
        autoComplete="off"
      >
        <TextField id="outlined-basic" label="Search your recipe" variant="outlined" />

      </Box>
      <Button sx={{ width: "20px" }} variant="contained">Search</Button>

    </div>
  );
}

export default App;
